import React,{useState} from "react";
import axiosInstance from "./AxiosInstance";
import SidebarLayout from "./SidebarLayout";
import {
  Container, 
  Box, 
  FormControl, 
  InputLabel, 
  Select, 
  MenuItem, 
  Button, 
  Table, 
  TableBody, 
  TableCell, 
  TableContainer, 
  TableHead, 
  TableRow, 
  Pagination
} from '@mui/material';

const Venue = () => {
    const [timeZone, setTimeZone] = useState('PST');
  const [state, setState] = useState('ca');
  const [instructor, setInstructor] = useState('1');
  const [venues, setVenues] = useState([]);
  const [currentPage, setCurrentPage] = useState(1);
  const [itemsPerPage] = useState(1);
  const [isLoading, setIsLoading] = useState(false);
  const handleSearch = () => {

    if (isLoading) return; // 避免重复请求
    setIsLoading(true);

  // 初始化查询参数
  let params = {
    pageNum: currentPage,
    pageSize: itemsPerPage,
    state,
    city:'',
    instructor: instructor,
    paymentMode: '',
    timeZone: timeZone,
  };

  // 移除空的参数
  Object.keys(params).forEach(key => {
    if (params[key] === '' || params[key] === null || params[key] === undefined) {
      delete params[key];
    }
  });

  // 发送请求
  axiosInstance.get('/venue', { params })
    .then(response => {
      console.log('Response received:', response); // 添加日志
      if (response.data.message==="success") {
        setVenues(response.data.data.items);
      } else {
        console.error('Error in response data:', response.data.message); // 添加日志
      }
    })
    .catch(error => {
      console.error('Error in request:', error); // 添加日志
    })
    .finally(() => {
      setIsLoading(false);
    });
};

  const handleReset = () => {
    setTimeZone('');
    setState('');
    setInstructor('');
    setVenues([]);
    setCurrentPage(1);
  };
  const handlePageChange = (event, value) => {
    setCurrentPage(value);
    handleSearch();
  };
  // 分页逻辑
  const indexOfLastItem = currentPage * itemsPerPage;
  const indexOfFirstItem = indexOfLastItem - itemsPerPage;
  const currentItems = venues.slice(indexOfFirstItem, indexOfLastItem);
  const totalPages = Math.ceil(venues.length / itemsPerPage);

  const Drawer = styled(MuiDrawer, { shouldForwardProp: (prop) => prop !== 'open' })(
    ({ theme, open }) => ({
      '& .MuiDrawer-paper': {
        position: 'relative',
        whiteSpace: 'nowrap',
        width: drawerWidth,
        transition: theme.transitions.create('width', {
          easing: theme.transitions.easing.sharp,
          duration: theme.transitions.duration.enteringScreen,
        }),
        boxSizing: 'border-box',
        ...(!open && {
          overflowX: 'hidden',
          transition: theme.transitions.create('width', {
            easing: theme.transitions.easing.sharp,
            duration: theme.transitions.duration.leavingScreen,
          }),
          width: theme.spacing(7),
          [theme.breakpoints.up('sm')]: {
            width: theme.spacing(9),
          },
        }),
      },
    }),
  );
  
  return (
    <SidebarLayout>
    <Container maxWidth="lg" sx={{ mt: 4, mb: 4 }}>
      <Box display="flex" alignItems="center" mb={3}>
        <FormControl variant="outlined" sx={{ minWidth: 200, mr: 2 }}>
          <InputLabel>Time Zone</InputLabel>
          <Select
            value={timeZone}
            onChange={(e) => setTimeZone(e.target.value)}
            label="Time Zone"
          >
            <MenuItem value=""><em>请选择</em></MenuItem>
            <MenuItem value="PST">PST</MenuItem>
            <MenuItem value="时区 2">时区 2</MenuItem>
            <MenuItem value="时区 3">时区 3</MenuItem>
          </Select>
        </FormControl>
        <FormControl variant="outlined" sx={{ minWidth: 200, mr: 2 }}>
          <InputLabel>State</InputLabel>
          <Select
            value={state}
            onChange={(e) => setState(e.target.value)}
            label="State"
          >
            <MenuItem value=""><em>请选择</em></MenuItem>
            <MenuItem value="ca">ca</MenuItem>
            <MenuItem value="州 2">州 2</MenuItem>
            <MenuItem value="州 3">州 3</MenuItem>
          </Select>
        </FormControl>
        <FormControl variant="outlined" sx={{ minWidth: 200, mr: 2 }}>
          <InputLabel>Instructor</InputLabel>
          <Select
            value={instructor}
            onChange={(e) => setInstructor(e.target.value)}
            label="讲师"
          >
            <MenuItem value=""><em>请选择</em></MenuItem>
            <MenuItem value="1">1</MenuItem>
            <MenuItem value="讲师 2">讲师 2</MenuItem>
            <MenuItem value="讲师 3">讲师 3</MenuItem>
          </Select>
        </FormControl>
        <Button variant="contained" color="primary" onClick={handleSearch} sx={{ mr: 2 }}>
          Search
        </Button>
        <Button variant="outlined" onClick={handleReset}>
          Reset
        </Button>
      </Box>
      <TableContainer>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>id</TableCell>
              <TableCell>address</TableCell>
              <TableCell>timeZone</TableCell>
              <TableCell>state</TableCell>
              <TableCell>instructor</TableCell>
              <TableCell>city</TableCell>
              <TableCell>cancellationPolicy</TableCell>
              <TableCell>paymentMode</TableCell>
              <TableCell>nonrefundableFee</TableCell>
              <TableCell>fobKey</TableCell>
              <TableCell>deposit</TableCell>
              <TableCell>membershipFee</TableCell>
              <TableCell>usageFee</TableCell>
              <TableCell>refundableStatus</TableCell>
              <TableCell>bookMethod</TableCell>
              <TableCell>registrationLink</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {currentItems.map((venue) => (
              <TableRow key={venue.id}>
                <TableCell>{venue.id}</TableCell>
                <TableCell>{venue.address}</TableCell>
                <TableCell>{venue.timeZone}</TableCell>
                <TableCell>{venue.state}</TableCell>
                <TableCell>{venue.instructor}</TableCell>
                <TableCell>{venue.city}</TableCell>
                <TableCell>{venue.cancellationPolicy}</TableCell>
                <TableCell>{venue.paymentMode}</TableCell>
                <TableCell>{venue.nonrefundableFee}</TableCell>
                <TableCell>{venue.fobKey}</TableCell>
                <TableCell>{venue.deposit}</TableCell>
                <TableCell>{venue.membershipFee}</TableCell>
                <TableCell>{venue.usageFee}</TableCell>
                <TableCell>{venue.refundableStatus}</TableCell>
                <TableCell>{venue.bookMethod}</TableCell>
                <TableCell>{venue.registrationLink}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
      <Box display="flex" justifyContent="center" mt={3}>
        <Pagination
          count={totalPages}
          page={currentPage}
          onChange={handlePageChange}
        />
      </Box>
    </Container>
  </SidebarLayout>
  );
};

export default Venue;
